import './styles/App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col, Navbar, Nav } from 'react-bootstrap';
import NavBar from './components/NavBar';
import HeroSection from './components/HeroSection';
import ContactBar from './components/ContactBar';
import Home from './context/Home';
import About from './context/About';
import Projects from './context/Projects';
import Price from './context/Price';
import Contact from './context/Contact';

function App() {
  return (
    <div fluid className="App  ">
      <video id="bgVideo" controls preload="true" autoplay loop muted>
        <source src="Home_Page.mp4" type="video/mp4" />
        <source src="Home_Page.ogv" type="video/ogv" />
        <source src="Home_Page.webm" type="video/webm" />
      </video>
      <Home />
      <About />
      <Projects />
      <Price />
      <ContactBar />
    </div>
  );
}

export default App;
